package service;

import model.Product;

import java.util.ArrayList;
import java.util.List;

public class ProductService implements IService<Product>{
    private List<Product> productList = new ArrayList<>();

    public ProductService() {
        productList.add(new Product(1, "BCS", 1, 60, "data:image/jpeg;base64,"));
        productList.add(new Product(2, "Rung", 2, 70, "data:image/jpeg;base64,"));
    }
    @Override
    public boolean add(Product product) {
        productList.add(product);
        return true;
    }

    @Override
    public boolean edit(Product product, int id) {
        int index = findById(id);
        if(index == -1) return false;
        else {
            productList.set(index, product);
            return true;
        }
    }

    @Override
    public boolean delete(int id) {
        int index = findById(id);
        if(index == -1) return false;
        else {
            productList.remove(index);
            return true;
        }
    }

    @Override
    public int findById(int id) {
        for (int i = 0; i < productList.size(); i++) {
            if(id == productList.get(i).getId()) return i;
        }
        return -1;
    }

    @Override
    public List<Product> findAll() {
        return this.productList;
    }
}
